    <div class="info-block info-slavonija fade-in" id="info-slavonija">
        <img src="{{ asset('uploads')}}/{{ $img_slavonija->naslovna_slika }}">
        <h2>Slavonija i Baranja</h2>
        <p>
        Slavonija je povijesna regija u istočnoj Hrvatskoj. 
        Leži između rijeke Drave na sjeveru (granica s Mađarskom), Save na jugu (granica s BiH), planine Papuk na zapadu i Dunava na istoku (granica s Srbijom). 
        Panonska ravnica je plodna te je svojim poljoprivrednim potencijalom oduvijek privlačila civilizacije jos od pretpovijesnih vremena. 
        Slavonija je glavna žitnica i poljoprivredno najrazvijeniji dio Hrvatske. Njezin zadatak kroz povijest je bila da nahrani Hrvatsku.
        </p>
        <a class="btn btn-cta text-uppercase" href="/regija/1">Detaljnije</a>
    </div>
    <div class="info-block info-sredisnja fade-in" id="info-sredisnja">
        <img src="{{ asset('uploads')}}/{{ $img_sredisnja->naslovna_slika }}">
            <h2>Središnja Hrvatska</h2>
            <p>
            Doživite središnju Hrvatsku kao nikada do sada. Središnja Hrvatska savršena je za odmor po mjeri čovjeka. Tradicija i običaji, idilično zeleno okruženje, romantični dvorci, vinski putevi i nezaboravna hrana. <br>
            Središnja Hrvatska dio je peripanonskog prostora i težište je naseljenosti i gospodarskog razvoja Hrvatske. Prostire se na otprilike trećini teritorija države, a na tom prostoru živi oko polovice ukupnog stanovništva (2,16 milijuna). 

            </p>
            <a class="btn btn-cta text-uppercase" href="/regija/2">Detaljnije</a>
